import React, { useEffect, useState } from "react";
import axios from "axios";
function Doctprofile() {
    const [person, setperson] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data);
            });
    }, [])
    return (
        <div class="container">
            {person.map((persons) => (
                 <div class="card-body" key={Math.random()}>
                <table style={{color: "red"}}>
                    <tbody>
                        <tr>
                            <td>Full Name</td>
                            <td>{persons.name}</td>
                        </tr>
                        <tr>
                            <td>Specialised</td>
                            <td>{persons.specialised}</td>
                        </tr>
                        <tr>
                            <td>Hours Work</td>
                            <td>{persons.hourwork}</td>
                        </tr>
                    </tbody>
                </table>
                </div>
            ))}
        </div>
    );
}


export default Doctprofile;
